import React, { useState } from 'react';
import { Button, Col, Row } from 'react-bootstrap';
import './cust_reg.css';

function Cust_reg() {
  const [formData, setFormData] = useState({
    firstName: '',
    lastName: '',
    phoneNumber: '',
    email: '',
    address: '',
    gender: '',
    birthday: '',
    nicNumber: '',
    occupation: '',
    username: '',
    password: '',
    reenterPassword: ''
  });

  const [formErrors, setFormErrors] = useState({
    firstName: '',
    lastName: '',
    phoneNumber: '',
    email: '',
    address: '',
    gender: '',
    birthday: '',
    nicNumber: '',
    occupation: '',
    username: '',
    password: '',
    reenterPassword: '',
    agreeCheckbox: ''
  });

  const validateField = (name, value) => {
    let error = '';

    // Check if the field is empty
    if (!value) {
      error = 'This field is required.';
    } else {
      // Perform field-specific validation
      switch (name) {
        case 'email':
          // Validate email format
          const emailRegex = /^[^\s@]+@[^\s@]+\.[^\s@]+$/;
          if (!emailRegex.test(value)) {
            error = 'Invalid email format.';
          }
          break;
        case 'phoneNumber':
          const phoneRegex = /^[0-9]{10}$/;
          if (!phoneRegex.test(value)) {
            error = 'Invalid phone number format.';
          }
          break;
        case 'nicNumber':
          const nicRegex = /^[0-9]{9}[Vv]$/;
          if (!nicRegex.test(value)) {
            error = 'Invalid NIC number format.';
          }
          break;
        default:
          break;
      }
    }

    setFormErrors((prevState) => ({
      ...prevState,
      [name]: error
    }));
  };

  const validateForm = () => {
    let isValid = true;

    // Check if all fields are filled
    for (const [key, value] of Object.entries(formData)) {
      if (!value) {
        setFormErrors((prevState) => ({
          ...prevState,
          [key]: 'This field is required.'
        }));
        isValid = false;
      }
    }

    // Check if password and reenterPassword match
    if (formData.password !== formData.reenterPassword) {
      setFormErrors((prevState) => ({
        ...prevState,
        reenterPassword: 'Passwords do not match.'
      }));
      isValid = false;
    }

    // Check if the checkbox is checked
    if (!formData.agreeCheckbox) {
      setFormErrors((prevState) => ({
        ...prevState,
        agreeCheckbox: 'Please agree to the Terms and Conditions and Privacy Policy.'
      }));
      isValid = false;
    }

    return isValid;
  };

  const handleChange = (e) => {
    const { name, value, type, checked } = e.target;
    const fieldValue = type === 'checkbox' ? checked : value;

    setFormData((prevState) => ({
      ...prevState,
      [name]: fieldValue
    }));

    validateField(name, fieldValue);
  };

  const handleSubmit = (e) => {
    e.preventDefault();

    // Perform overall form validation
    const isValid = validateForm();

    if (isValid) {
      // Perform form submission or further processing here
      console.log('Form is valid. Submitting...');
      // Redirect to another page
      // Example: window.location.href = '/next-page';
    } else {
      console.log('Form contains errors. Please fix them.');
    }
  };

  return (
    <div className="form-container">
      <h2 className="form-heading">Customer Registration Form</h2>

      <form onSubmit={handleSubmit}>
        {/* Form fields */}

        {/* Checkbox */}
        <Row>
          <Col xs={12} lg={12}>
            <span>
              <label>
                <input
                  type="checkbox"
                  name="agreeCheckbox"
                  checked={formData.agreeCheckbox}
                  onChange={handleChange}
                />
                <span style={{ color: 'white', marginLeft: '10px' }}>
                  I have read and agreed to the Terms and Conditions and Privacy Policy.
                </span>
              </label>
              {formErrors.agreeCheckbox && <span className="error">{formErrors.agreeCheckbox}</span>}
            </span>
          </Col>
        </Row>

        {/* Submit button */}
        <Row>
          <Col xs={12}>
            <button type="submit" style={{ width: '25%', backgroundColor: 'silver', marginLeft: '90%' }}>
              Register
            </button>
          </Col>
        </Row>

        {/* Login link */}
        <Row>
          <Col style={{ display: 'flex' }}>
            <p style={{ color: 'white' }}>Already have an account?</p>

            <Button style={{ backgroundColor: 'red', borderColor: 'red', margin: '0% 3%' }} href="/login">
              Login
            </Button>
          </Col>
          <Col></Col>
        </Row>
      </form>
    </div>
  );
}

export default Cust_reg;
